Let's now look at the updated Tick library. The first change is in the Tick.Info structure: we now have two variables to track tick liquidity: struct Info { bool initialized; // total liquidity at tick uint128 liquidityGross; // amount of liquidity added or subtracted when tick is crossed int128 liquidityNet;
} liquidityGross tracks the absolute liquidity amount of a tick. It's needed to find if a tick was flipped or not. liquidityNet, on the other hand, is a signed integer–it tracks the amount of liquidity added (in case of lower tick) or removed (in case of upper tick) when a tick is crossed. liquidityNet is set in the update function: function update( mapping(int24 => Tick.Info) storage self, int24 tick, int128 liquidityDelta, bool upper
) internal returns (bool flipped) { ... tickInfo.liquidityNet = upper ? int128(int256(tickInfo.liquidityNet) - liquidityDelta) : int128(int256(tickInfo.liquidityNet) + liquidityDelta);
} The cross function we saw above simply returns liquidityNet (it'll get more complicated after we introduce new features in later milestones): function cross(mapping(int24 => Tick.Info) storage self, int24 tick) internal view returns (int128 liquidityDelta)
{ Tick.Info storage info = self[tick]; liquidityDelta = info.liquidityNet;
}

