) public returns (int256 amount0, int256 amount1) { ... if ( zeroForOne ? sqrtPriceLimitX96 > slot0_.sqrtPriceX96 || sqrtPriceLimitX96 < TickMath.MIN_SQRT_RATIO : sqrtPriceLimitX96 < slot0_.sqrtPriceX96 && sqrtPriceLimitX96 > TickMath.MAX_SQRT_RATIO ) revert InvalidPriceLimit(); ... When selling token $x$ (zeroForOne is true), sqrtPriceLimitX96 must be between the current price and the minimal $\sqrt{P}$ since selling token $x$ moves the price down. Likewise, when selling token $y$, sqrtPriceLimitX96 must be between the current price and the maximal $\sqrt{P}$ because the price moves up. In the while loop, we want to satisfy two conditions: the full swap amount has not been filled and the current price isn't equal to sqrtPriceLimitX96: ..
while ( state.amountSpecifiedRemaining > 0 && state.sqrtPriceX96 != sqrtPriceLimitX96
) {
... This means that Uniswap V3 pools don't fail when slippage tolerance gets hit and simply execute the swap partially. Another place where we need to consider sqrtPriceLimitX96 is when calling SwapMath.computeSwapStep: (state.sqrtPriceX96, step.amountIn, step.amountOut) = SwapMath .computeSwapStep( state.sqrtPriceX96, ( zeroForOne ? step.sqrtPriceNextX96 < sqrtPriceLimitX96 : step.sqrtPriceNextX96 > sqrtPriceLimitX96 ) ? sqrtPriceLimitX96 : step.sqrtPriceNextX96, state.liquidity, state.amountSpecifiedRemaining ); Here, we want to ensure that computeSwapStep never calculates swap amounts outside of sqrtPriceLimitX96–this guarantees that the current price will never cross the limiting price.

