The functions we're going to implement allow us to calculate liquidity ($L = \sqrt{xy}$) when token amounts and price ranges are known. Luckily, we already know all the formulas. Let's recall this one: $$\Delta x = \Delta \frac{1}{\sqrt{P}}L$$ In a previous chapter, we used this formula to calculate swap amounts ($\Delta x$ in this case) and now we're going to use it to find $L$: $$L = \frac{\Delta x}{\Delta \frac{1}{\sqrt{P}}}$$ Or, after simplifying it: $$L = \frac{\Delta x \sqrt{P_u} \sqrt{P_l}}{\sqrt{P_u} - \sqrt{P_l}}$$ We derived this formula in Liquidity Amount Calculation . In Solidity, we'll again use PRBMath to handle overflows when multiplying and then dividing: function getLiquidityForAmount0( uint160 sqrtPriceAX96, uint160 sqrtPriceBX96, uint256 amount0
) internal pure returns (uint128 liquidity) { if (sqrtPriceAX96 > sqrtPriceBX96) (sqrtPriceAX96, sqrtPriceBX96) = (sqrtPriceBX96, sqrtPriceAX96); uint256 intermediate = PRBMath.mulDiv( sqrtPriceAX96, sqrtPriceBX96, FixedPoint96.Q96 ); liquidity = uint128( PRBMath.mulDiv(amount0, intermediate, sqrtPriceBX96 - sqrtPriceAX96) );
}

