In Uniswap V2 flash loans were part of the swapping functionality: it was possible to borrow tokens during a swap, but you had to return them or an equal amount of the other pool token, in the same transaction. In V3, flash loans are separated from swapping–it's simply a function that gives the caller a number of tokens they requested, calls a callback on the caller, and ensures a flash loan was repaid: function flash( uint256 amount0, uint256 amount1, bytes calldata data
) public { uint256 balance0Before = IERC20(token0).balanceOf(address(this)); uint256 balance1Before = IERC20(token1).balanceOf(address(this)); if (amount0 > 0) IERC20(token0).transfer(msg.sender, amount0); if (amount1 > 0) IERC20(token1).transfer(msg.sender, amount1); IUniswapV3FlashCallback(msg.sender).uniswapV3FlashCallback(data); require(IERC20(token0).balanceOf(address(this)) >= balance0Before); require(IERC20(token1).balanceOf(address(this)) >= balance1Before); emit Flash(msg.sender, amount0, amount1);
} The function sends tokens to the caller and then calls uniswapV3FlashCallback on it–this is where the caller is expected to repay the loan. Then the function ensures that its balances haven't decreased. Notice that custom data is allowed to be passed to the callback. Here's an example of the callback implementation: function uniswapV3FlashCallback(bytes calldata data) public { (uint256 amount0, uint256 amount1) = abi.decode( data, (uint256, uint256) ); if (amount0 > 0) token0.transfer(msg.sender, amount0); if (amount1 > 0) token1.transfer(msg.sender, amount1);
} In this implementation, we're simply sending tokens back to the pool (I used this callback in flash function tests). In reality, it can use the loaned amounts to perform some operations on other DeFi protocols. But it always must repay the loan in this callback. And that's it!

