Add Liquidity dialog window This change will finally remove hard-coded liquidity amounts from our code and will allow us to add liquidity at arbitrary ranges. The dialog is a simple component with a couple of inputs. We can even re-use the addLiquidity function from the previous implementation. However, now we need to convert prices to tick indices in JavaScript: we want users to type in prices but the contracts expect ticks. To make our job easier, we'll use the official Uniswap V3 SDK for that. To convert price to $\sqrt{P}$, we can use encodeSqrtRatioX96 function. The function takes two amounts as input and calculates a price by dividing one by the other. Since we only want to convert price to $\sqrt{P}$, we can pass 1 as amount0: const priceToSqrtP = (price) => encodeSqrtRatioX96(price, 1); To convert price to tick index, we can use TickMath.getTickAtSqrtRatio function. This is an implementation of the Solidity TickMath library in JavaScript: const priceToTick = (price) => TickMath.getTickAtSqrtRatio(priceToSqrtP(price)); So we can now convert prices typed in by users to ticks: const lowerTick = priceToTick(lowerPrice);
const upperTick = priceToTick(upperPrice); Another thing we need to add here is slippage protection. For simplicity, I made it a hard-coded value and set it to 0.5%. Here's how to use slippage tolerance to calculate minimal amounts: const slippage = 0.5;
const amount0Desired = ethers.utils.parseEther(amount0);
