In the constructor of Factory, we need to initialize supported tick spacings: // src/UniswapV3Factory.sol
contract UniswapV3Factory is IUniswapV3PoolDeployer { mapping(uint24 => bool) public tickSpacings; constructor() { tickSpacings[10] = true; tickSpacings[60] = true; } ... We could've made them constants, but we'll need to have it as a mapping for a later milestone (tick spacings will have different swap fee amounts). The Factory contract is a contract with only one function createPool. The function begins with the necessary checks we need to make before creating a pool: // src/UniswapV3Factory.sol
contract UniswapV3Factory is IUniswapV3PoolDeployer { PoolParameters public parameters; mapping(address => mapping(address => mapping(uint24 => address))) public pools; ... function createPool( address tokenX, address tokenY, uint24 tickSpacing ) public returns (address pool) { if (tokenX == tokenY) revert TokensMustBeDifferent(); if (!tickSpacings[tickSpacing]) revert UnsupportedTickSpacing(); (tokenX, tokenY) = tokenX < tokenY ? (tokenX, tokenY) : (tokenY, tokenX); if (tokenX == address(0)) revert TokenXCannotBeZero(); if (pools[tokenX][tokenY][tickSpacing] != address(0)) revert PoolAlreadyExists(); ... Notice that this is the first time when we're sorting tokens: (tokenX, tokenY) = tokenX < tokenY ? (tokenX, tokenY) : (tokenY, tokenX); From now on, we'll also expect pool token addresses to be sorted, i.e. token0 goes before token1 when sorted. We'll enforce this to make salt (and pool addresses) computation consistent. This change also affects how we deploy tokens in tests and the deployment script: we need to ensure that WETH is always token0 to make price calculations simpler in Solidity (otherwise, we'd need to use fractional prices, like 1/5000). If WETH is not token0 in your tests, change the order of token deployments. After that, we prepare pool parameters and deploy a pool: parameters = PoolParameters({ factory: address(this), token0: tokenX, token1: tokenY, tickSpacing: tickSpacing
}); pool = address( new UniswapV3Pool{ salt: keccak256(abi.encodePacked(tokenX, tokenY, tickSpacing)) }()
); delete parameters; This piece looks weird because parameters is not used. Uniswap uses Inversion of Control to pass parameters to a pool during deployment. Let's look at the updated Pool contract constructor: // src/UniswapV3Pool.sol
contract UniswapV3Pool is IUniswapV3Pool { ... constructor() { (factory, token0, token1, tickSpacing) = IUniswapV3PoolDeployer( msg.sender ).parameters(); } ..
} Aha! Pool expects its deployer to implement the IUniswapV3PoolDeployer interface (which only defines the parameters() getter) and calls it in the constructor during deployment to get the parameters. This is what the flow looks like: Factory: defines parameters state variable (implements IUniswapV3PoolDeployer) and sets it before deploying a pool. Factory: deploys a pool. Pool: in the constructor, calls the parameters() function on its deployer and expects that pool parameters are returned. Factory: calls delete parameters; to clean up the slot of the parameters state variable and to reduce gas consumption. This is a temporary state variable that has a value only during a call to createPool(). After a pool is created, we keep it in the pools mapping (so it can be found by its tokens) and emit an event: pools[tokenX][tokenY][tickSpacing] = pool; pools[tokenY][tokenX][tickSpacing] = pool; emit PoolCreated(tokenX, tokenY, tickSpacing, pool);
}

