Let's now implement a library that will help us calculate pool contract addresses from other contracts. This library will have only one function, computeAddress: // src/lib/PoolAddress.sol
library PoolAddress { function computeAddress( address factory, address token0, address token1, uint24 tickSpacing ) internal pure returns (address pool) { require(token0 < token1); ... The function needs to know pool parameters (they're used to build a salt) and the Factory contract address. It expects the tokens to be sorted, which we discussed above. Now, the core of the function: pool = address( uint160( uint256( keccak256( abi.encodePacked( hex"ff", factory, keccak256( abi.encodePacked(token0, token1, tickSpacing) ), keccak256(type(UniswapV3Pool).creationCode) ) ) ) )
); This is what CREATE2 does under the hood to calculate the new contract address. Let's unwind it: first, we calculate salt (abi.encodePacked(token0, token1, tickSpacing)) and hash it; then, we obtain the Pool contract code (type(UniswapV3Pool).creationCode) and also hash it; then, we build a sequence of bytes that includes: 0xff, the Factory contract address, hashed salt, and hashed Pool contract code; we then hash the sequence and convert it to an address. These steps implement contract address generation as it's defined in EIP-1014 , which is the EIP that added the CREATE2 opcode. Let's look closer at the values that constitute the hashed byte sequence: 0xff, as defined in the EIP, is used to distinguish addresses generated by CREATE and CREATE2; factory is the address of the deployer, in our case the Factory contract; salt was discussed earlier–it uniquely identifies a pool; hashed contract code is needed to protect from collisions: different contracts can have the same salt, but their code hash will be different. So, according to this scheme, a contract address is a hash of the values that uniquely identify this contract, including its deployer, code, and unique parameters. We can use this function from anywhere to find a pool address without making any external calls and without querying the factory.

