Let's begin with calculating the number of pools in a path: // src/lib/Path.sol
library Path { /// @dev The length the bytes encoded address uint256 private constant ADDR_SIZE = 20; /// @dev The length the bytes encoded tick spacing uint256 private constant TICKSPACING_SIZE = 3; /// @dev The offset of a single token address + tick spacing uint256 private constant NEXT_OFFSET = ADDR_SIZE + TICKSPACING_SIZE; /// @dev The offset of an encoded pool key (tokenIn + tick spacing + tokenOut) uint256 private constant POP_OFFSET = NEXT_OFFSET + ADDR_SIZE; /// @dev The minimum length of a path that contains 2 or more pools; uint256 private constant MULTIPLE_POOLS_MIN_LENGTH = POP_OFFSET + NEXT_OFFSET; ... We first define a few constants: ADDR_SIZE is the size of an address, 20 bytes; TICKSPACING_SIZE is the size of a tick spacing, 3 bytes (uint24); NEXT_OFFSET is the offset of a next token address–to get it, we skip an address and a tick spacing; POP_OFFSET is the offset of a pool key (token address + tick spacing + token address); MULTIPLE_POOLS_MIN_LENGTH is the minimum length of a path that contains 2 or more pools (one set of pool parameters + tick spacing + token address). To count the number of pools in a path, we subtract the size of an address (first or last token in a path) and divide the remaining part by NEXT_OFFSET (address + tick spacing): function numPools(bytes memory path) internal pure returns (uint256) { return (path.length - ADDR_SIZE) / NEXT_OFFSET;
}

