To implement other functions, we'll need a helper library because Solidity doesn't have native bytes manipulation functions. Specifically, we'll need a function to extract a sub-array from an array of bytes, and a couple of functions to convert bytes to address and uint24. Luckily, there's a great open-source library called solidity-bytes-utils . To use the library, we need to extend the bytes type in the Path library: library Path { using BytesLib for bytes; ...
} We can implement getFirstPool now: function getFirstPool(bytes memory path) internal pure returns (bytes memory)
{ return path.slice(0, POP_OFFSET);
