Suppose we have a whole bunch of pools: Scattered pools How do we find the shortest path between two tokens in such a mess? The most suitable solution for such kinds of tasks is based on a graph . A graph is a data structure that consists of nodes (objects representing something) and edges (links connecting nodes). We can turn that mess of pools into a graph where each node is a token (that has a pool) and each edge is a pool this token belongs to. So a pool represented as a graph is two nodes connected with an edge. The above pools become this graph: Pools graph The biggest advantage graphs give us is the ability to traverse its nodes, from one node to another, to find paths. Specifically, we'll use A* search algorithm . Feel free to learn about how the algorithm works, but, in our app, we'll use a library to make our life easier. The set of libraries we'll use is ngraph.ngraph for building graphs and ngraph.path for finding paths (it's the latter that implements A* search algorithm, as well as some others). In the UI app, let's create a pathfinder. This will be a class that, when instantiated, turns a list of pairs into a graph to later use the graph to find the shortest path between two tokens. import createGraph from 'ngraph.graph';
import path from 'ngraph.path'; class PathFinder { constructor(pairs) { this.graph = createGraph(); pairs.forEach((pair) => { this.graph.addNode(pair.token0.address); this.graph.addNode(pair.token1.address); this.graph.addLink(pair.token0.address, pair.token1.address, pair.tickSpacing); this.graph.addLink(pair.token1.address, pair.token0.address, pair.tickSpacing); }); this.finder = path.aStar(this.graph); } ... In the constructor, we're creating an empty graph and fill it with linked nodes. Each node is a token address and links have associated data, which is tick spacings–we'll be able to extract this information from paths found by A*. After initializing a graph, we instantiate the A* algorithm implementation. Next, we need to implement a function that will find a path between tokens and turn it into an array of token addresses and tick spacings: findPath(fromToken, toToken) { return this.finder.find(fromToken, toToken).reduce((acc, node, i, orig) => { if (acc.length > 0) { acc.push(this.graph.getLink(orig[i - 1].id, node.id).data); } acc.push(node.id); return acc; }, []).reverse();
} this.finder.find(fromToken, toToken) returns a list of nodes and, unfortunately, doesn't contain the information about edges between them (we store tick spacings in edges). Thus, we're calling this.graph.getLink(previousNode, currentNode) to find edges. Now, whenever the user changes the input or output token, we can call pathFinder.findPath(token0, token1) to build a new path.

