In the Uniswap V3 SDK , the function that does that is called nearestUsableTick : /** * Returns the closest tick that is nearest a given tick and usable for the given tick spacing * @param tick the target tick * @param tickSpacing the spacing of the pool */
export function nearestUsableTick(tick: number, tickSpacing: number) { invariant(Number.isInteger(tick) && Number.isInteger(tickSpacing), 'INTEGERS') invariant(tickSpacing > 0, 'TICK_SPACING') invariant(tick >= TickMath.MIN_TICK && tick <= TickMath.MAX_TICK, 'TICK_BOUND') const rounded = Math.round(tick / tickSpacing) * tickSpacing if (rounded < TickMath.MIN_TICK) return rounded + tickSpacing else if (rounded > TickMath.MAX_TICK) return rounded - tickSpacing else return rounded
} At its core, it's just: Math.round(tick / tickSpacing) * tickSpacing Where Math.round is rounding to the nearest integer: when the fractional part is less than 0.5, it rounds to the lower integer; when it's greater than 0.5 it rounds to the greater integer; and when it's 0.5, it rounds to the greater integer as well. So, in the web app, we'll use nearestUsableTick when building mint parameters: const mintParams = { tokenA: pair.token0.address, tokenB: pair.token1.address, tickSpacing: pair.tickSpacing, lowerTick: nearestUsableTick(lowerTick, pair.tickSpacing), upperTick: nearestUsableTick(upperTick, pair.tickSpacing), amount0Desired, amount1Desired, amount0Min, amount1Min
} In reality, it should be called whenever the user adjusts a price range because we want the user to see the actual price that will be created. In our simplified app, we make it less user-friendly. However, we also want to have a similar function in Solidity tests, but neither of the math libraries we're using implements it.

