In our smart contract tests, we need a way to round ticks and convert rounded prices to $\sqrt{P}$. In a previous chapter, we chose to use ABDKMath64x64 to handle fixed-point numbers math in tests. The library, however, doesn't implement the rounding function we need to port nearestUsableTick, so we'll need to implement it ourselves: function divRound(int128 x, int128 y) internal pure returns (int128 result)
{ int128 quot = ABDKMath64x64.div(x, y); result = quot >> 64; // Check if remainder is greater than 0.5 if (quot % 2**64 >= 0x8000000000000000) { result += 1; }
} The function does multiple things: it divides two Q64.64 numbers; it then rounds the result to the decimal one (result = quot >> 64), the fractional part is lost at this point (i.e. the result is rounded down); it then divides the quotient by $2^{64}$, takes the remainder, and compares it with 0x8000000000000000 (which is 0.5 in Q64.64); if the remainder is greater or equal to 0.5, it rounds the result to the greater integer. What we get is an integer rounded according to the rules of Math.round from JavaScript. We can then re-implement nearestUsableTick: function nearestUsableTick(int24 tick_, uint24 tickSpacing) internal pure returns (int24 result)
{ result = int24(divRound(int128(tick_), int128(int24(tickSpacing)))) * int24(tickSpacing); if (result < TickMath.MIN_TICK) { result += int24(tickSpacing); } else if (result > TickMath.MAX_TICK) { result -= int24(tickSpacing); }
} That's it!

