Let's now see how to interpret observations. The observe function we just added returns an array of accumulated prices, and we want to know how to convert them to actual prices. I'll demonstrate this in a test of the observe function. In the test, I ran multiple swaps in different directions and at different blocks: function testObserve() public { ... pool.increaseObservationCardinalityNext(3); vm.warp(2); pool.swap(address(this), false, swapAmount, sqrtP(6000), extra); vm.warp(7); pool.swap(address(this), true, swapAmount2, sqrtP(4000), extra); vm.warp(20); pool.swap(address(this), false, swapAmount, sqrtP(6000), extra); ... vm.warp is a cheat code provided by Foundry: it forwards to a block with the specified timestamp. 2, 7, 20 – these are block timestamps. The first swap is made at the block with timestamp 2, the second one is made at timestamp 7, and the third one is made at timestamp 20. We can then read the observations: ... secondsAgos = new uint32[](4); secondsAgos[0] = 0; secondsAgos[1] = 13; secondsAgos[2] = 17; secondsAgos[3] = 18; int56[] memory tickCumulatives = pool.observe(secondsAgos); assertEq(tickCumulatives[0], 1607059); assertEq(tickCumulatives[1], 511146); assertEq(tickCumulatives[2], 170370); assertEq(tickCumulatives[3], 85176); ... The earliest observed price is 0, which is the initial observation that's set when the pool is deployed. However, since the cardinality was set to 3 and we made 3 swaps, it was overwritten by the last observation. During the first swap, tick 85176 was observed, which is the initial price of the pool–recall that the price before a swap is observed. Because the very first observation was overwritten, this is the oldest observation now. The next returned accumulated price is 170370, which is 85176 + 85194. The former is the previous accumulator value, the latter is the price after the first swap that was observed during the second swap. The next returned accumulated price is 511146, which is (511146 - 170370) / (17 - 13) = 85194, the accumulated price between the second and the third swap. Finally, the most recent observation is 1607059, which is (1607059 - 511146) / (20 - 7) = 84301, which is ~4581 USDC/ETH, the price after the second swap that was observed during the third swap. Here's an example that involves interpolation: the time points requested are not the time points of the swaps: secondsAgos = new uint32[](5);
secondsAgos[0] = 0;
secondsAgos[1] = 5;
secondsAgos[2] = 10;
secondsAgos[3] = 15;
secondsAgos[4] = 18; tickCumulatives = pool.observe(secondsAgos);
assertEq(tickCumulatives[0], 1607059);
assertEq(tickCumulatives[1], 1185554);
assertEq(tickCumulatives[2], 764049);
assertEq(tickCumulatives[3], 340758);
assertEq(tickCumulatives[4], 85176); This results in prices: 4581.03, 4581.03, 4747.6, and 5008.91, which are the average prices within the requested intervals. Here's how to compute those values in Python: vals = [1607059, 1185554, 764049, 340758, 85176]
secs = [0, 5, 10, 15, 18]
[1.0001**((vals[i] - vals[i+1]) / (secs[i+1] - secs[i])) for i in range(len(vals)-1)]

