To let the user choose how much liquidity to remove, we first need to fetch the user's positions from a pool. To make this easier, we can add a helper function to the Manager contract, which will return the user position in a specific pool: function getPosition(GetPositionParams calldata params) public view returns ( uint128 liquidity, uint256 feeGrowthInside0LastX128, uint256 feeGrowthInside1LastX128, uint128 tokensOwed0, uint128 tokensOwed1 )
{ IUniswapV3Pool pool = getPool(params.tokenA, params.tokenB, params.fee); ( liquidity, feeGrowthInside0LastX128, feeGrowthInside1LastX128, tokensOwed0, tokensOwed1 ) = pool.positions( keccak256( abi.encodePacked( params.owner, params.lowerTick, params.upperTick ) ) );
} This will free us from calculating a pool address and a position key on the front end. Then, after the user has typed in a position range, we can try fetching a position: const getAvailableLiquidity = debounce((amount, isLower) => { const lowerTick = priceToTick(isLower ? amount : lowerPrice); const upperTick = priceToTick(isLower ? upperPrice : amount); const params = { tokenA: token0.address, tokenB: token1.address, fee: fee, owner: account, lowerTick: nearestUsableTick(lowerTick, feeToSpacing[fee]), upperTick: nearestUsableTick(upperTick, feeToSpacing[fee]), } manager.getPosition(params) .then(position => setAvailableAmount(position.liquidity.toString())) .catch(err => console.error(err));
}, 500);

