Since we need to call burn and collect on a pool, we still need to compute the pool's address on the front end. Recall that pool addresses are computed using the CREATE2 opcode, which requires a salt and the hash of the contract's code. Luckily, Ether.js has the getCreate2Address function that allows to compute CREATE2 in JavaScript: const sortTokens = (tokenA, tokenB) => { return tokenA.toLowerCase() < tokenB.toLowerCase ? [tokenA, tokenB] : [tokenB, tokenA];
} const computePoolAddress = (factory, tokenA, tokenB, fee) => { [tokenA, tokenB] = sortTokens(tokenA, tokenB); return ethers.utils.getCreate2Address( factory, ethers.utils.keccak256( ethers.utils.solidityPack( ['address', 'address', 'uint24'], [tokenA, tokenB, fee] )), poolCodeHash );
} However, the pool's codehash has to be hard coded because we don't want to store its code on the front end to calculate the hash. So, we'll use Forge to get the hash: $ forge inspect UniswapV3Pool bytecode| xargs cast keccak 0x... And then use the output value in a JS constant: const poolCodeHash = "0x9dc805423bd1664a6a73b31955de538c338bac1f5c61beb8f4635be5032076a2";

