Minting, as we discussed earlier, will involve two operations: adding liquidity to a pool and minting an NFT. To keep the links between pool liquidity positions and NFTs, we'll need a mapping and a structure: struct TokenPosition { address pool; int24 lowerTick; int24 upperTick;
}
mapping(uint256 => TokenPosition) public positions; To find a position we need: a pool address; an owner address; the boundaries of a position (lower and upper ticks). Since the NFT manager contract will be the owner of all positions created via it, we don't need to store the position's owner address and we can only store the rest data. The keys in the positions mapping are token IDs; the mapping links NFT IDs to the position data that is required to find a liquidity position. Let's implement minting: struct MintParams { address recipient; address tokenA; address tokenB; uint24 fee; int24 lowerTick; int24 upperTick; uint256 amount0Desired; uint256 amount1Desired; uint256 amount0Min; uint256 amount1Min;
} function mint(MintParams calldata params) public returns (uint256 tokenId) { ...
} The minting parameters are identical to those of UniswapV3Manager, with the addition of recipient, which will allow minting NFT to another address. In the mint function, we first add liquidity to a pool: IUniswapV3Pool pool = getPool(params.tokenA, params.tokenB, params.fee); (uint128 liquidity, uint256 amount0, uint256 amount1) = _addLiquidity( AddLiquidityInternalParams({ pool: pool, lowerTick: params.lowerTick, upperTick: params.upperTick, amount0Desired: params.amount0Desired, amount1Desired: params.amount1Desired, amount0Min: params.amount0Min, amount1Min: params.amount1Min })
); _addLiquidity is identical to the body of the mint function in the UniswapV3Manager contract: it converts ticks to $\sqrt(P)$, computes liquidity amount, and calls pool.mint(). Next, we mint an NFT: tokenId = nextTokenId++;
_mint(params.recipient, tokenId);
totalSupply++; tokenId is set to the current nextTokenId and the latter is then incremented. The _mint function is provided by the ERC721 contract from Solmate. After minting a new token, we update totalSupply. Finally, we need to store the information about the new token and the new position: TokenPosition memory tokenPosition = TokenPosition({ pool: address(pool), lowerTick: params.lowerTick, upperTick: params.upperTick
}); positions[tokenId] = tokenPosition; This will later help us find liquidity position by token ID.

