Next, we'll implement a function to add liquidity to an existing position, in the case when we want to add more liquidity in a position that already has some. In such cases, we don't want to mint an NFT, but only to increase the amount of liquidity in an existing position. For that, we'll only need to provide a token ID and token amounts: function addLiquidity(AddLiquidityParams calldata params) public returns ( uint128 liquidity, uint256 amount0, uint256 amount1 )
{ TokenPosition memory tokenPosition = positions[params.tokenId]; if (tokenPosition.pool == address(0x00)) revert WrongToken(); (liquidity, amount0, amount1) = _addLiquidity( AddLiquidityInternalParams({ pool: IUniswapV3Pool(tokenPosition.pool), lowerTick: tokenPosition.lowerTick, upperTick: tokenPosition.upperTick, amount0Desired: params.amount0Desired, amount1Desired: params.amount1Desired, amount0Min: params.amount0Min, amount1Min: params.amount1Min }) );
} This function ensures there's an existing token and calls pool.mint() with parameters of an existing position.

186.body:
Recall that in the UniswapV3Manager contract we didn't implement a burn function because we wanted users to be owners of liquidity positions. Now, we want the NFT manager to be the owner. And we can have liquidity burning implemented in it: struct RemoveLiquidityParams { uint256 tokenId; uint128 liquidity;
} function removeLiquidity(RemoveLiquidityParams memory params) public isApprovedOrOwner(params.tokenId) returns (uint256 amount0, uint256 amount1)
{ TokenPosition memory tokenPosition = positions[params.tokenId]; if (tokenPosition.pool == address(0x00)) revert WrongToken(); IUniswapV3Pool pool = IUniswapV3Pool(tokenPosition.pool); (uint128 availableLiquidity, , , , ) = pool.positions( poolPositionKey(tokenPosition) ); if (params.liquidity > availableLiquidity) revert NotEnoughLiquidity(); (amount0, amount1) = pool.burn( tokenPosition.lowerTick, tokenPosition.upperTick, params.liquidity );
} We're again checking that the provided token ID is valid. And we also need to ensure that a position has enough liquidity to burn.

