Then we can render the SVG template: string memory image = string.concat( "<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 300 480'>", "<style>.tokens { font: bold 30px sans-serif; }", ".fee { font: normal 26px sans-serif; }", ".tick { font: normal 18px sans-serif; }</style>", renderBackground(params.owner, params.lowerTick, params.upperTick), renderTop(symbol0, symbol1, params.fee), renderBottom(params.lowerTick, params.upperTick), "</svg>"
); The template is broken down into multiple steps: first comes the header, which includes the CSS styles; then the background is rendered; then the top position information is rendered (token symbols and fee); finally, the bottom information is rendered (position ticks). The background is simply two rects. To render them we need to find the unique hue of this token and then we concatenate all the pieces together: function renderBackground( address owner, int24 lowerTick, int24 upperTick
) internal pure returns (string memory background) { bytes32 key = keccak256(abi.encodePacked(owner, lowerTick, upperTick)); uint256 hue = uint256(key) % 360; background = string.concat( '<rect width="300" height="480" fill="hsl(', Strings.toString(hue), ',40%,40%)"/>', '<rect x="30" y="30" width="240" height="420" rx="15" ry="15" fill="hsl(', Strings.toString(hue), ',100%,50%)" stroke="#000"/>' );
} The top template renders token symbols and pool fees: function renderTop( string memory symbol0, string memory symbol1, uint24 fee
) internal pure returns (string memory top) { top = string.concat( '<rect x="30" y="87" width="240" height="42"/>', '<text x="39" y="120" class="tokens" fill="#fff">', symbol0, "/", symbol1, "</text>" '<rect x="30" y="132" width="240" height="30"/>', '<text x="39" y="120" dy="36" class="fee" fill="#fff">', feeToText(fee), "</text>" );
} Fees are rendered as numbers with a fractional part. Since all possible fees are known in advance we don't need to convert integers to fractional numbers and can simply hardcode the values: function feeToText(uint256 fee) internal pure returns (string memory feeString)
{ if (fee == 500) { feeString = "0.05%"; } else if (fee == 3000) { feeString = "0.3%"; }
} In the bottom part, we render position ticks: function renderBottom(int24 lowerTick, int24 upperTick) internal pure returns (string memory bottom)
{ bottom = string.concat( '<rect x="30" y="342" width="240" height="24"/>', '<text x="39" y="360" class="tick" fill="#fff">Lower tick: ', tickToText(lowerTick), "</text>", '<rect x="30" y="372" width="240" height="24"/>', '<text x="39" y="360" dy="30" class="tick" fill="#fff">Upper tick: ', tickToText(upperTick), "</text>" );
} Since ticks can be positive and negative, we need to render them properly (with or without the minus sign): function tickToText(int24 tick) internal pure returns (string memory tickString)
{ tickString = string.concat( tick < 0 ? "-" : "", tick < 0 ? Strings.toString(uint256(uint24(-tick))) : Strings.toString(uint256(uint24(tick))) );
}

