As you've learned from the introduction, Uniswap deploys multiple Pool contracts, each of which is an exchange market of a pair of tokens. Uniswap groups all its contracts into two categories: core contracts, and periphery contracts. Core contracts are, as the name implies, contracts that implement core logic. These are minimal, user- un friendly, low-level contracts. Their purpose is to do one thing and do it as reliably and securely as possible. In Uniswap V3, there are 2 such contracts: Pool contract, which implements the core logic of a decentralized exchange. Factory contract, which serves as a registry of Pool contracts and a contract that makes deployment of pools easier. We'll begin with the pool contract, which implements 99% of the core functionality of Uniswap. Create src/UniswapV3Pool.sol: pragma solidity ^0.8.14; contract UniswapV3Pool {} Let's think about what data the contract will store: Since every pool contract is an exchange market of two tokens, we need to track the two token addresses. These addresses will be static, set once and forever during pool deployment (thus, they will be immutable). Each pool contract is a set of liquidity positions. We'll store them in a mapping, where keys are unique position identifiers and values are structs holding information about positions. Each pool contract will also need to maintain a ticks registry–this will be a mapping with keys being tick indexes and values being structs storing information about ticks. Since the tick range is limited, we need to store the limits in the contract, as constants. Recall that pool contracts store the amount of liquidity, $L$. So we'll need to have a variable for it. Finally, we need to track the current price and the related tick. We'll store them in one storage slot to optimize gas consumption: these variables will be often read and written together, so it makes sense to benefit from the state variables packing feature of Solidity . All in all, this is what we begin with: // src/lib/Tick.sol
library Tick { struct Info { bool initialized; uint128 liquidity; } ...
} // src/lib/Position.sol
library Position { struct Info { uint128 liquidity; } ...
} // src/UniswapV3Pool.sol
contract UniswapV3Pool { using Tick for mapping(int24 => Tick.Info); using Position for mapping(bytes32 => Position.Info); using Position for Position.Info; int24 internal constant MIN_TICK = -887272; int24 internal constant MAX_TICK = -MIN_TICK; // Pool tokens, immutable address public immutable token0; address public immutable token1; // Packing variables that are read together struct Slot0 { // Current sqrt(P) uint160 sqrtPriceX96; // Current tick int24 tick; } Slot0 public slot0; // Amount of liquidity, L. uint128 public liquidity; // Ticks info mapping(int24 => Tick.Info) public ticks; // Positions info mapping(bytes32 => Position.Info) public positions; ... Uniswap V3 uses many helper contracts and Tick and Position are two of them. using A for B is a feature of Solidity that lets you extend type B with functions from library contract A. This simplifies managing complex data structures. For brevity, I'll omit a detailed explanation of Solidity syntax and features. Solidity has great documentation , don't hesitate to refer to it if something is not clear! We'll then initialize some of the variables in the constructor: constructor( address token0_, address token1_, uint160 sqrtPriceX96, int24 tick ) { token0 = token0_; token1 = token1_; slot0 = Slot0({sqrtPriceX96: sqrtPriceX96, tick: tick}); }
} Here, we're setting the token address immutables and setting the current price and tick–we don't need to provide liquidity for the latter. This is our starting point, and our goal in this chapter is to make our first swap using pre-calculated and hard-coded values.

