The process of providing liquidity in Uniswap V2 is called minting . The reason is that the V2 pool contract mints tokens (LP-tokens) in exchange for liquidity. V3 doesn't do that, but it still uses the same name for the function. Let's use it as well: function mint( address owner, int24 lowerTick, int24 upperTick, uint128 amount
) external returns (uint256 amount0, uint256 amount1) { ... Our mint function will take: Owner's address, to track the owner of the liquidity. Upper and lower ticks, to set the bounds of a price range. The amount of liquidity we want to provide. Notice that user specifies $L$, not actual token amounts. This is not very convenient of course, but recall that the Pool contract is a core contract–it's not intended to be user-friendly because it should implement only the core logic. In a later chapter, we'll make a helper contract that will convert token amounts to $L$ before calling Pool.mint. Let's outline a quick plan of how minting will work: a user specifies a price range and an amount of liquidity; the contract updates the ticks and positions mappings; the contract calculates token amounts the user must send (we'll pre-calculate and hard code them); the contract takes tokens from the user and verifies that the correct amounts were set. Let's begin with checking the ticks: if ( lowerTick >= upperTick || lowerTick < MIN_TICK || upperTick > MAX_TICK
) revert InvalidTickRange(); And ensuring that some amount of liquidity is provided: if (amount == 0) revert ZeroLiquidity(); Then, add a tick and a position: ticks.update(lowerTick, amount);
ticks.update(upperTick, amount); Position.Info storage position = positions.get( owner, lowerTick, upperTick
);
position.update(amount); The ticks.update function is: // src/lib/Tick.sol
function update( mapping(int24 => Tick.Info) storage self, int24 tick, uint128 liquidityDelta
) internal { Tick.Info storage tickInfo = self[tick]; uint128 liquidityBefore = tickInfo.liquidity; uint128 liquidityAfter = liquidityBefore + liquidityDelta; if (liquidityBefore == 0) { tickInfo.initialized = true; } tickInfo.liquidity = liquidityAfter;
} It initializes a tick if it has 0 liquidity and adds new liquidity to it. As you can see, we're calling this function on both lower and upper ticks, thus liquidity is added to both of them. The position.update function is: // src/libs/Position.sol
function update(Info storage self, uint128 liquidityDelta) internal { uint128 liquidityBefore = self.liquidity; uint128 liquidityAfter = liquidityBefore + liquidityDelta; self.liquidity = liquidityAfter;
} Similar to the tick update function, it adds liquidity to a specific position. To get a position we call: // src/libs/Position.sol
...
function get( mapping(bytes32 => Info) storage self, address owner, int24 lowerTick, int24 upperTick
) internal view returns (Position.Info storage position) { position = self[ keccak256(abi.encodePacked(owner, lowerTick, upperTick)) ];
}
... Each position is uniquely identified by three keys: owner address, lower tick index, and upper tick index. We hash the three to make storing data cheaper: when hashed, every key will take 32 bytes, instead of 96 bytes when owner, lowerTick, and upperTick are separate keys. If we use three keys, we need three mappings. Each key would be stored separately and would take 32 bytes since Solidity stores values in 32-byte slots (when packing is not applied). Next, continuing with minting, we need to calculate the amounts that the user must deposit. Luckily, we have already figured out the formulas and calculated the exact amounts in the previous part. So, we're going to hard-code them: amount0 = 0.998976618347425280 ether;
amount1 = 5000 ether; We'll replace these with actual calculations in a later chapter. We will also update the liquidity of the pool, based on the amount being added. liquidity += uint128(amount); Now, we're ready to take tokens from the user. This is done via a callback: function mint(...) ... { ... uint256 balance0Before; uint256 balance1Before; if (amount0 > 0) balance0Before = balance0(); if (amount1 > 0) balance1Before = balance1(); IUniswapV3MintCallback(msg.sender).uniswapV3MintCallback( amount0, amount1 ); if (amount0 > 0 && balance0Before + amount0 > balance0()) revert InsufficientInputAmount(); if (amount1 > 0 && balance1Before + amount1 > balance1()) revert InsufficientInputAmount(); ...
} function balance0() internal returns (uint256 balance) { balance = IERC20(token0).balanceOf(address(this));
} function balance1() internal returns (uint256 balance) { balance = IERC20(token1).balanceOf(address(this));
} First, we record current token balances. Then we call the uniswapV3MintCallback method on the caller–this is the callback. It's expected that the caller (whoever calls mint) is a contract because non-contract addresses cannot implement functions in Ethereum. Using a callback here, while not being user-friendly at all, lets the contract calculate token amounts using its current state–this is critical because we cannot trust users. The caller is expected to implement uniswapV3MintCallback and transfer tokens to the Pool contract in this function. After calling the callback function, we continue with checking whether the Pool contract balances have changed or not: we require them to increase by at least amount0 and amount1 respectively–this would mean the caller has transferred tokens to the pool. Finally, we're firing a Mint event: emit Mint(msg.sender, owner, lowerTick, upperTick, amount, amount0, amount1); Events is how contract data is indexed in Ethereum for later search. It's a good practice to fire an event whenever the contract's state is changed to let blockchain explorer know when this happened. Events also carry useful information. In our case, it's the caller's address, the liquidity position owner's address, upper and lower ticks, new liquidity, and token amounts. This information will be stored as a log, and anyone else will be able to collect all contract events and reproduce the activity of the contract without traversing and analyzing all blocks and transactions. And we're done! Phew! Now, let's test minting.

