At this point, we don't know if everything works correctly. Before deploying our contract anywhere we're going to write a bunch of tests to ensure the contract works correctly. Luckily for us, Forge is a great testing framework and it'll make testing a breeze. Create a new test file: // test/UniswapV3Pool.t.sol
