{ token0.mint(address(this), params.wethBalance); token1.mint(address(this), params.usdcBalance); pool = new UniswapV3Pool( address(token0), address(token1), params.currentSqrtP, params.currentTick ); if (params.mintLiqudity) { (poolBalance0, poolBalance1) = pool.mint( address(this), params.lowerTick, params.upperTick, params.liquidity ); } shouldTransferInCallback = params.shouldTransferInCallback;
} In this function, we're minting tokens and deploying a pool. Also, when the mintLiquidity flag is set, we mint liquidity in the pool. In the end, we're setting the shouldTransferInCallback flag for it to be read in the mint callback: function uniswapV3MintCallback(uint256 amount0, uint256 amount1) public { if (shouldTransferInCallback) { token0.transfer(msg.sender, amount0); token1.transfer(msg.sender, amount1); }
} It's the test contract that will provide liquidity and will call the mint function on the pool, there're no users. The test contract will act as a user, thus it can implement the mint callback function. Setting up test cases like that is not mandatory, you can do it however feels most comfortable to you. Test contracts are just contracts. In testMintSuccess, we want to ensure that the pool contract: takes the correct amounts of tokens from us; creates a position with correct key and liquidity; initializes the upper and lower ticks we've specified; has correct $\sqrt{P}$ and $L$. Let's do this. Minting happens in setupTestCase, so we don't need to do this again. The function also returns the amounts we have provided, so let's check them: (uint256 poolBalance0, uint256 poolBalance1) = setupTestCase(params); uint256 expectedAmount0 = 0.998976618347425280 ether;
uint256 expectedAmount1 = 5000 ether;
assertEq( poolBalance0, expectedAmount0, "incorrect token0 deposited amount"
);
assertEq( poolBalance1, expectedAmount1, "incorrect token1 deposited amount"
); We expect specific pre-calculated amounts. And we can also check that these amounts were transferred to the pool: assertEq(token0.balanceOf(address(pool)), expectedAmount0);
assertEq(token1.balanceOf(address(pool)), expectedAmount1); Next, we need to check the position the pool created for us. Remember that the key in positions mapping is a hash? We need to calculate it manually and then get our position from the contract: bytes32 positionKey = keccak256( abi.encodePacked(address(this), params.lowerTick, params.upperTick)
);
uint128 posLiquidity = pool.positions(positionKey);
assertEq(posLiquidity, params.liquidity); Since Position.Info is a struct , it gets destructured when fetched: each field gets assigned to a separate variable. Next, come the ticks. Again, it's straightforward: (bool tickInitialized, uint128 tickLiquidity) = pool.ticks( params.lowerTick
);
assertTrue(tickInitialized);
assertEq(tickLiquidity, params.liquidity); (tickInitialized, tickLiquidity) = pool.ticks(params.upperTick);
assertTrue(tickInitialized);
assertEq(tickLiquidity, params.liquidity); And finally, $\sqrt{P}$ and $L$: (uint160 sqrtPriceX96, int24 tick) = pool.slot0();
assertEq( sqrtPriceX96, 5602277097478614198912276234240, "invalid current sqrtP"
);
