} Key points here: The function transfers tokens belonging to the test contract–we want it to transfer tokens from the caller by using transferFrom. The function knows token0 and token1, which will be different for every pool. Idea: we need to change the arguments of the callback so we can pass user and pool addresses. Now, let's look at the swap callback: function uniswapV3SwapCallback(int256 amount0, int256 amount1) public { if (amount0 > 0 && transferInSwapCallback) { token0.transfer(msg.sender, uint256(amount0)); } if (amount1 > 0 && transferInSwapCallback) { token1.transfer(msg.sender, uint256(amount1)); }
} Identically, it transfers tokens from the test contract and it knows token0 and token1. To pass the extra data to the callbacks, we need to pass it to mint and swap first (since callbacks are called from these functions). However, since this extra data is not used in the functions and to not make their arguments messier, we'll encode the extra data using abi.encode() . Let's define the extra data as a structure: // src/UniswapV3Pool.sol
...
struct CallbackData { address token0; address token1; address payer;
}
