) external returns (uint256 amount0, uint256 amount1) { ... IUniswapV3MintCallback(msg.sender).uniswapV3MintCallback( amount0, amount1, data // <--- New line ); ...
} function swap(address recipient, bytes calldata data) // <--- `data` added public returns (int256 amount0, int256 amount1)
{ ... IUniswapV3SwapCallback(msg.sender).uniswapV3SwapCallback( amount0, amount1, data // <--- New line ); ...
} Now, we can read the extra data in the callbacks in the test contract. function uniswapV3MintCallback( uint256 amount0, uint256 amount1, bytes calldata data
) public { if (transferInMintCallback) { UniswapV3Pool.CallbackData memory extra = abi.decode( data, (UniswapV3Pool.CallbackData) ); IERC20(extra.token0).transferFrom(extra.payer, msg.sender, amount0); IERC20(extra.token1).transferFrom(extra.payer, msg.sender, amount1); }
