At its core, deploying a contract means: Compiling source code into EVM bytecode. Sending a transaction with the bytecode. Creating a new address, executing the constructor part of the bytecode, and storing deployed bytecode on the address. This step is done automatically by an Ethereum node when your contract creation transaction is mined. Deployment usually consists of multiple steps: preparing parameters, deploying auxiliary contracts, deploying main contracts, initializing contracts, etc. Scripting helps to automate these steps, and we'll write scripts in Solidity! Create scripts/DeployDevelopment.sol contract with this content: // SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.14; import "forge-std/Script.sol"; contract DeployDevelopment is Script { function run() public { ... }
} It looks very similar to the test contract, with only difference is that it inherits from the Script contract, not from Test. And, by convention, we need to define the run function which will be the body of our deployment script. In the run function, we define the parameters of the deployment first: uint256 wethBalance = 1 ether;
uint256 usdcBalance = 5042 ether;
int24 currentTick = 85176;
