The next step is finding ticks with liquidity using the bitmap index. During swapping, we need to find a tick with liquidity that's before or after the current tick (that is: to the left or the right of it). In the previous milestone, we used to calculate and hard code it , but now we need to find such tick using the bitmap index. We'll do this in the TickBitmap.nextInitializedTickWithinOneWord function. In this function, we'll need to implement two scenarios: When selling token $x$ (ETH in our case), find the next initialized tick in the current tick's word and to the right of the current tick. When selling token $y$ (USDC in our case), find the next initialized tick in the next (current + 1) tick's word and to the left of the current tick. This corresponds to the price movement when making swaps in either direction: Finding next initialized tick during a swap Be aware that, in the code, the direction is flipped: when buying token $x$, we search for initialized ticks to the left of the current; when selling token $x$, we search ticks to the right . But this is only true within a word; words are ordered from left to right. When there's no initialized tick in the current word, we'll continue searching in an adjacent word in the next loop cycle. Now, let's look at the implementation: function nextInitializedTickWithinOneWord( mapping(int16 => uint256) storage self, int24 tick, int24 tickSpacing, bool lte
) internal view returns (int24 next, bool initialized) { int24 compressed = tick / tickSpacing; ... The first argument makes this function a method of mapping(int16 => uint256). tick is the current tick. tickSpacing is always 1 until we start using it in Milestone 4. lte is the flag that sets the direction. When true, we're selling token $x$ and searching for the next initialized tick to the right of the current one. When false, it's the other way around. lte equals the swap direction: true when selling token $x$, false otherwise. if (lte) { (int16 wordPos, uint8 bitPos) = position(compressed); uint256 mask = (1 << bitPos) - 1 + (1 << bitPos); uint256 masked = self[wordPos] & mask; ... When selling $x$, we're: taking the current tick's word and bit positions; making a mask where all bits to the right of the current bit position, including it, are ones (mask is all ones, its length = bitPos); applying the mask to the current tick's word. ... initialized = masked != 0; next = initialized ? (compressed - int24(uint24(bitPos - BitMath.mostSignificantBit(masked)))) * tickSpacing : (compressed - int24(uint24(bitPos))) * tickSpacing; ... Next, masked won't equal 0 if at least one bit of it is set to 1. If so, there's an initialized tick; if not, there isn't (not in the current word). Depending on the result, we either return the index of the next initialized tick or the leftmost bit in the next word–this will allow us to search for initialized ticks in the word during another loop cycle. ...
} else { (int16 wordPos, uint8 bitPos) = position(compressed + 1); uint256 mask = ~((1 << bitPos) - 1); uint256 masked = self[wordPos] & mask; ... Similarly, when selling $y$, we: take the current tick's word and bit positions; make a different mask, where all bits to the left of the current tick bit position are ones and all the bits to the right are zeros; apply the mask to the current tick's word. Again, if there are no initialized ticks to the left, the rightmost bit of the previous word is returned: ... initialized = masked != 0; // overflow/underflow is possible, but prevented externally by limiting both tickSpacing and tick next = initialized ? (compressed + 1 + int24(uint24((BitMath.leastSignificantBit(masked) - bitPos)))) * tickSpacing : (compressed + 1 + int24(uint24((type(uint8).max - bitPos)))) * tickSpacing;
} And that's it! As you can see, nextInitializedTickWithinOneWord doesn't find the exact tick if it's far away–its scope of search is current or next tick's word. Indeed, we don't want to iterate over the infinite bitmap index.

