The biggest change in the mint function is switching to tokens amount calculation. In Milestone 1, we hard-coded these values: amount0 = 0.998976618347425280 ether; amount1 = 5000 ether; And now we're going to calculate them in Solidity using formulas from Milestone 1. Let's recall those formulas: $$\Delta x = \frac{L(\sqrt{p(i_u)} - \sqrt{p(i_c)})}{\sqrt{p(i_u)}\sqrt{p(i_c)}}$$ $$\Delta y = L(\sqrt{p(i_c)} - \sqrt{p(i_l)})$$ $\Delta x$ is the amount of token0, or token $x$. Let's implement it in Solidity: // src/lib/Math.sol
function calcAmount0Delta( uint160 sqrtPriceAX96, uint160 sqrtPriceBX96, uint128 liquidity
) internal pure returns (uint256 amount0) { if (sqrtPriceAX96 > sqrtPriceBX96) (sqrtPriceAX96, sqrtPriceBX96) = (sqrtPriceBX96, sqrtPriceAX96); require(sqrtPriceAX96 > 0); amount0 = divRoundingUp( mulDivRoundingUp( (uint256(liquidity) << FixedPoint96.RESOLUTION), (sqrtPriceBX96 - sqrtPriceAX96), sqrtPriceBX96 ), sqrtPriceAX96 );
} This function is identical to calc_amount0 in our Python script. The first step is to sort the prices to ensure we don't underflow when subtracting. Next, we convert liquidity to a Q96.64 number by multiplying it by 2**96. Next, according to the formula, we multiply it by the difference of the prices and divide it by the bigger price. Then, we divide by the smaller price. The order of division doesn't matter, but we want to have two divisions because the multiplication of prices can overflow. We're using mulDivRoundingUp to multiply and divide in one operation. This function is based on mulDiv from PRBMath: function mulDivRoundingUp( uint256 a, uint256 b, uint256 denominator
) internal pure returns (uint256 result) { result = PRBMath.mulDiv(a, b, denominator); if (mulmod(a, b, denominator) > 0) { require(result < type(uint256).max); result++; }
} mulmod is a Solidity function that multiplies two numbers (a and b), divides the result by denominator, and returns the remainder. If the remainder is positive, we round the result up. Next, $\Delta y$: function calcAmount1Delta( uint160 sqrtPriceAX96, uint160 sqrtPriceBX96, uint128 liquidity
) internal pure returns (uint256 amount1) { if (sqrtPriceAX96 > sqrtPriceBX96) (sqrtPriceAX96, sqrtPriceBX96) = (sqrtPriceBX96, sqrtPriceAX96); amount1 = mulDivRoundingUp( liquidity, (sqrtPriceBX96 - sqrtPriceAX96), FixedPoint96.Q96 );
