Let's now look at Math.getNextSqrtPriceFromInput–the function calculates a $\sqrt{P}$ given another $\sqrt{P}$, liquidity, and input amount. It tells what the price will be after swapping the specified input amount of tokens, given the current price and liquidity. The good news is that we already know the formulas: recall how we calculated price_next in Python: # When amount_in is token0
price_next = int((liq * q96 * sqrtp_cur) // (liq * q96 + amount_in * sqrtp_cur))
# When amount_in is token1
price_next = sqrtp_cur + (amount_in * q96) // liq We're going to implement this in Solidity: // src/lib/Math.sol
function getNextSqrtPriceFromInput( uint160 sqrtPriceX96, uint128 liquidity, uint256 amountIn, bool zeroForOne
) internal pure returns (uint160 sqrtPriceNextX96) { sqrtPriceNextX96 = zeroForOne ? getNextSqrtPriceFromAmount0RoundingUp( sqrtPriceX96, liquidity, amountIn ) : getNextSqrtPriceFromAmount1RoundingDown( sqrtPriceX96, liquidity, amountIn );
} The function handles swapping in both directions. Since calculations are different, we'll implement them in separate functions. function getNextSqrtPriceFromAmount0RoundingUp( uint160 sqrtPriceX96, uint128 liquidity, uint256 amountIn
) internal pure returns (uint160) { uint256 numerator = uint256(liquidity) << FixedPoint96.RESOLUTION; uint256 product = amountIn * sqrtPriceX96; if (product / amountIn == sqrtPriceX96) { uint256 denominator = numerator + product; if (denominator >= numerator) { return uint160( mulDivRoundingUp(numerator, sqrtPriceX96, denominator) ); } } return uint160( divRoundingUp(numerator, (numerator / sqrtPriceX96) + amountIn) );
} In this function, we're implementing two formulas. At the first return, it implements the same formula we implemented in Python. This is the most precise formula, but it can overflow when multiplying amountIn by sqrtPriceX96. The formula is (we discussed it in "Output Amount Calculation"): $$\sqrt{P_{target}} = \frac{\sqrt{P}L}{\Delta x \sqrt{P} + L}$$ When it overflows, we use an alternative formula, which is less precise: $$\sqrt{P_{target}} = \frac{L}{\Delta x + \frac{L}{\sqrt{P}}}$$ Which is simply the previous formula with the numerator and the denominator divided by $\sqrt{P}$ to get rid of the multiplication in the numerator. The other function has simpler math: function getNextSqrtPriceFromAmount1RoundingDown( uint160 sqrtPriceX96, uint128 liquidity, uint256 amountIn
) internal pure returns (uint160) { return sqrtPriceX96 + uint160((amountIn << FixedPoint96.RESOLUTION) / liquidity);
}

