} From this piece, you can also see that we always update the liquidity tracker (which tracks only currently available liquidity, i.e. liquidity available at the current price). However, in reality, price ranges can also be created below or above the current price. That's it: the design of Uniswap V3 allows liquidity providers to provide liquidity that doesn't get immediately used. Such liquidity gets "injected" when the current price gets into such "sleeping" price ranges. These are kinds of price ranges that can exist: Active price range, i.e. one that includes the current price. Price range placed below the current price. The upper tick of this range is below the current tick. Price range placed above the current price. The lower tick of this range is above the current tick.

