In the swap function, we're iterating over initialized ticks (that is, ticks with liquidity) to fill the amount the user has requested. In each iteration, we: find the next initialized tick using tickBitmap.nextInitializedTickWithinOneWord; swap in the range between the current price and the next initialized tick (using SwapMath.computeSwapStep); always expect that the current liquidity is enough to satisfy the swap (i.e. the price after a swap is between the current price and the next initialized tick). But what happens if the third step is not true? We have this scenario covered in tests: // test/UniswapV3Pool.t.sol
function testSwapBuyEthNotEnoughLiquidity() public { ... uint256 swapAmount = 5300 ether; ... vm.expectRevert(stdError.arithmeticError); pool.swap(address(this), false, swapAmount, extra);
} The "Arithmetic over/underflow" happens when the pool tries to send us more ether than it has. This error happens because, in our current implementation, we always expect that there's enough liquidity to satisfy any swap: // src/lib/SwapMath.sol
function computeSwapStep(...) { ... sqrtPriceNextX96 = Math.getNextSqrtPriceFromInput( sqrtPriceCurrentX96, liquidity, amountRemaining, zeroForOne ); amountIn = ... amountOut = ...
} To improve this, we need to consider several situations: when the range between the current and the next ticks has enough liquidity to fill amountRemaining; when the range doesn't fill the entire amountRemaining. In the first case, the swap is done entirely within the range–this is the scenario we have implemented. In the second situation, we'll consume the whole liquidity provided by the range and will move to the next range (if it exists). With this in mind, let's rework computeSwapStep: // src/lib/SwapMath.sol
function computeSwapStep(...) { ... amountIn = zeroForOne ? Math.calcAmount0Delta( sqrtPriceCurrentX96, sqrtPriceTargetX96, liquidity ) : Math.calcAmount1Delta( sqrtPriceCurrentX96, sqrtPriceTargetX96, liquidity ); if (amountRemaining >= amountIn) sqrtPriceNextX96 = sqrtPriceTargetX96; else sqrtPriceNextX96 = Math.getNextSqrtPriceFromInput( sqrtPriceCurrentX96, liquidity, amountRemaining, zeroForOne ); amountIn = Math.calcAmount0Delta( sqrtPriceCurrentX96, sqrtPriceNextX96, liquidity ); amountOut = Math.calcAmount1Delta( sqrtPriceCurrentX96, sqrtPriceNextX96, liquidity );
} First, we calculate amountIn–the input amount the current range can satisfy. If it's smaller than amountRemaining, we say that the current price range cannot fulfill the whole swap, thus the next $\sqrt{P}$ is the upper/lower $\sqrt{P}$ of the price range (in other words, we use the entire liquidity of the price range). If amountIn is greater than amountRemaining, we compute sqrtPriceNextX96–it'll be a price within the current price range. In the end, after figuring out the next price, we re-compute amountIn and compute amountOut within this shorter price range (we don't consume the entire liquidity). I hope this makes sense!

