Now, in the swap function, we need to handle the case we introduced in the previous part: when the swap price reaches a boundary of a price range. When this happens, we want to deactivate the price range we're leaving and activate the next price range. We also want to start another iteration of the loop and try to find another tick with liquidity. Before updating the loop, let's save the second value returned by the tickBitmap.nextInitializedTickWithinOneWord() call into step.initialized: (step.nextTick, step.initialized) = tickBitmap.nextInitializedTickWithinOneWord( state.tick, 1, zeroForOne
); (In the previous milestone we stored only step.nextTick.) Knowing if the next tick is initialized or not will help us save some gas in situations when there's no initialized tick in the current word in the ticks bitmap. Now, here's what we need to add to the end of the loop: if (state.sqrtPriceX96 == step.sqrtPriceNextX96) { if (step.initialized) { int128 liquidityDelta = ticks.cross(step.nextTick); if (zeroForOne) liquidityDelta = -liquidityDelta; state.liquidity = LiquidityMath.addLiquidity( state.liquidity, liquidityDelta ); if (state.liquidity == 0) revert NotEnoughLiquidity(); } state.tick = zeroForOne ? step.nextTick - 1 : step.nextTick;
} else { state.tick = TickMath.getTickAtSqrtRatio(state.sqrtPriceX96);
} The second branch is what we had before–it handles the case when the current price stays within the range. So let's focus on the first one. Here, we're updating the current liquidity, but only if the next tick is initialized (if it's not, we skip adding 0 to the liquidity to save gas). state.sqrtPriceX96 is the new current price, i.e. the price that will be set after the current swap; step.sqrtPriceNextX96 is the price at the next initialized tick. If these are equal, we have reached a price range boundary. As explained above, when this happens, we want to update $L$ (add or remove liquidity) and continue the swap using the boundary tick as the current tick. By convention, crossing a tick means crossing it from left to right. Thus, crossing lower ticks always adds liquidity, and crossing upper ticks always removes it. However, when zeroForOne is true, we negate the sign: when the price goes down (token $x$ is being sold), upper ticks add liquidity and lower ticks remove it. When updating state.tick, if the price moves down (zeroForOne is true), we need to subtract 1 to step out of the price range. When moving up (zeroForOne is false), the current tick is always excluded in TickBitmap.nextInitializedTickWithinOneWord. Another small, but very important, change that we need to make is to update $L$ when crossing a tick. We do this after the loop: if (liquidity_ != state.liquidity) liquidity = state.liquidity; Within the loop, we update state.liquidity multiple times when entering/leaving price ranges. After a swap, we need to update the global $L$ for it to reflect the liquidity available at the new current price. Also, the reason why we only update the global variable when finishing the swap is gas consumption optimization, since writing to the storage of a contract is an expensive operation.
